import styled from 'styled-components'




const Caption = (props) => {
    return (
        <div>
             <h3>{props.Nom}</h3>
             <p>What a wonderful nature</p>
             
        </div>
    );
};

const CaptionPicture =styled.div`
    margin-left: 10px;
    width: 60px;
    height: 70px;

`
export default Caption;
